import  './Category.css'

const Category = () => {
  return (
    <div className='Category'>
    <button type="button" class="btn btn-primary me-3">All</button>
    <button type="button" class="btn btn-secondary me-3">S</button>
     <button type="button" class="btn btn-danger me-3">Danger</button>
     <button type="button" class="btn btn-info">Info</button>
      </div>
  )
}

export default Category
